import React from "react";
import ReactDOM from "react-dom";
import Header from "./components/Header.js";
import ProfileSection from "./components/ProfileSection.js";
import ProjectThumbnail from "./components/ProjectThumbnail.js";
import SectionContainer from "./components/SectionContainer.js";
import InfoRect from "./components/InfoRect.js"

function App() {
  return (
    <div>
      <Header />
      <ProfileSection />
      <SectionContainer theme="dark">
        <ProjectThumbnail projectName="My dotfiles" src="#" alt="My dotfiles" />
        <ProjectThumbnail projectName="My dotfiles" src="#" alt="My dotfiles" />
        <ProjectThumbnail projectName="My dotfiles" src="#" alt="My dotfiles" />
        <ProjectThumbnail projectName="My dotfiles" src="#" alt="My dotfiles" />
      </SectionContainer>
      <SectionContainer theme="light"></SectionContainer>
    </div>
  );
}

ReactDOM.render(<App />, document.querySelector("#root"));
